s.aV(0,"Size Effect",new A.aW8(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/size_effect_example.dart","    The `SizeEffect` changes the size of the component, the sizes of the\n    children will stay the same.\n    In this example you can tap the screen and the component will size up or\n    down, depending on its current state.\n  ")
s.aV(0,"Scale Effect",new A.aW9(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/scale_effect_example.dart","    In this example you can tap the screen and the component will scale up or\n    down, depending on its current state.\n    \n    The star pulsates randomly using a RandomEffectController.\n  ")
s.aV(0,"Opacity Effect",new A.aWa(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/opacity_effect_example.dart","    In this example we show how the `OpacityEffect` can be used in two ways.\n    The left Ember will constantly pulse in and out of opacity and the right\n    flame will change opacity when you click the screen.\n  ")
s.aV(0,"Color Effect",new A.aWb(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/color_effect_example.dart","    In this example we show how the `ColorEffect` can be used.\n    Ember will constantly pulse in and out of a blue color.\n  ")
s.aV(0,"Sequence Effect",new A.aWc(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/sequence_effect_example.dart","    Sequence of effects, consisting of a move effect, a rotate effect, another\n    move effect, a scale effect, and then one more move effect. The sequence\n    then runs in the opposite order (alternate = true) and loops infinitely\n    (infinite = true).\n  ")
s.aV(0,"Remove Effect",new A.aWd(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/effects/remove_effect_example.dart","    Click on any circle to apply a RemoveEffect, which will make the circle\n    disappear after a 0.5 second delay.\n  ")
